            DEBUGMSGTL(("internal:ieee8021BridgeBaseTable:_mfd_ieee8021BridgeBaseTable_get_column",
                        "column %d (ieee8021BridgeBaseTrafficClassesEnabled) doesn't exist\n", column));
            return MFD_SKIP;
